  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Fish Springs
  National Wildlife Refuge outlines Refuge accomplishments during the 2013 calendar
  year. This Annual Narrative Report covers 2013 Refuge activities not reported in
  the 2013 Annual Habitat Work Plan (AHWP), 2013 Water Management Plan (2013 Water
  Use and 2014 Water Use Plan), and the 2013 Water Delivery System Annual Maintenance
  Plan and Completion Report. The latter two reports are included as appendices in
  the AHWP. Introductory descriptions of the Refuge have been provided in past Annual
  Narrative Reports. Topics covered in this narrative include planning, administration,
  habitat management, wildlife, public use, and equipment and facilities.\",\n\t\"owner_org\":
